import React, { useState } from 'react';
import './Admit_hos.css';

const Admit_hos = () => {
  const [email, setEmail] = useState('');
  const [policyNumber, setPolicyNumber] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    alert('Claim submitted successfully!');
    window.location.href = '/user';
  };

  return (
    <div className="claim-form-container-2">
      <form className="claim-form-2" onSubmit={handleSubmit}>
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        <input
          type="text"
          placeholder="Policy Number"
          value={policyNumber}
          onChange={(e) => setPolicyNumber(e.target.value)}
          required
        />
        <button type="submit">Submit Claim</button>
      </form>
      <div className='claim-bg2'>
      <video src='/videos/video-15.mp4' autoPlay loop muted />
      </div>
      <div className='claim-bg2-1'>
        <h1>Check Patient Status..</h1>
      </div>
      <div className='side-2'></div>
    </div>
  );
};

export default Admit_hos;
